import Icons from "../../Global/Icons"
export default function Stories(){
    return(
        <div class="stories">
            {stories().map( props =>
                <Story user={props.user} source={props.src} />
            )}
            <div class="setinha">
              <Icons name="chevron-forward-circle" />
            </div>
        </div>
    )
}
function AllStorys(){
    const users = ["9gag", "meowed", "barked", "nathanwpylestrangeplanet", "wawawicomics","respondeai", "filomoderna", "memeriagourmet"]
    const stories = []
    for(let i = 0; i < users.length;i++){
        stories.push({user:users[i], src:`assets/img/${users[i]}.svg`})
    }
    return stories
}
function Story(props){
    return (
        <div class="story">
                <div class="imagem">
                    <img src={props.source} />
                </div>
                <div class="usuario">
                {props.user}
                </div>
        </div>
    )
}
